ipt src="/w/load.php?debug=false&amp;lang=en&amp;modules=html5shiv&amp;only=scripts&amp;skin=vector&amp;sync=1"></script><![endif]--> </head> <body class="mediawiki ltr sitedir-ltr mw-hide-empty-elt ns-0 ns-subject page-All rootpage-All skin-vector action-view">		<div id="mw-page-base" class="noprint"></div> 		<div id="mw-head-base" class="noprint"></div> 		<div id="content" class="mw-body" role="main"> 			<a id="top"></a> 			<div id="siteNotice" class="mw-body-content"><!-- CentralNotice --></div><div class="mw-indicators mw-body-content"> </div> <h1 id="firstHeading" class="firstHeading" lang="en">All</h1>			<div id="bodyContent" class="mw-body-content"> 				<div id="siteSub" class="noprint">From Wikipedia, the free encyclopedia</div>				<div id="contentSub"></div> 								<div id="jump-to-nav" class="mw-jump"> 					Jump to:					<a href="#mw-head">navigation</a>, 					<a href="#p-search">search</a> 				</div> 				<div id="mw-content-text" lang="en" dir="ltr" class="mw-content-ltr"><div class="mw-parser-output"><table role="presentation" class="mbox-small plainlinks sistersitebox" style="background-color:#f9f9f9;border:1px solid #aaa;color:#000"> <tr> <td class="mbox-image"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/40px-Wiktionary-logo-en-v2.svg.png" width="40" height="40" class="noviewer" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/60px-Wiktionary-logo-en-v2.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/80px-Wiktionary-logo-en-v2.svg.png 2x" data-file-width="391" data-file-height="391" /></td> <td class="mbox-text plainlist">Look up <i><b><a href="https://en.wiktionary.org/wiki/all" class="extiw" title="wiktionary:all">all</a></b></i>, <i><b><a href="https://en.wiktionary.org/wiki/All" class="extiw" title="wiktionary:All">All</a></b></i>, <i><b><a href="https://en.wiktionary.org/wiki/ALL" class="extiw" title="wiktionary:ALL">ALL</a></b></i>, or <i><b><a href="https://en.wiktionary.org/wiki/Appendix:Variations_of_%22all%22" class="extiw" title="wiktionary:Appendix:Variations of &quot;all&quot;">Appendix:Variations of "all"</a></b></i> in Wiktionary, the free dictionary.</td> </tr> </table> <p><b>All</b> or <b>ALL</b> may refer to:</p> <ul> <li>all, an <a href="/wiki/Indefinite_pronoun" title="Indefinite pronoun">indefinite pronoun</a> in English</li> <li>all, one of the <a href="/wiki/English_determiners" title="English determiners">English determiners</a></li> <li><a href="/wiki/ALL_(complexity)" title="ALL (complexity)">ALL (complexity)</a>, the class of all decision problems in computability and complexity theory</li> <li><a href="/wiki/All,_Missouri" title="All, Missouri">All, Missouri</a>, a community in the United States</li> <li>All, abbreviation for <a href="/wiki/Allyl" class="mw-redirect" title="Allyl">allyl</a></li> <li>All, a concept of <a href="/wiki/Universal_quantification" title="Universal quantification">universal quantification</a> in <a href="/wiki/Predicate_logic" class="mw-redirect" title="Predicate logic">predicate logic</a></li> <li>All, a laundry detergent manufactured by <a href="/wiki/Sun_Products" title="Sun Products">Sun Products</a></li> <li>All, pseudonym of <a href="/wiki/Jim_Berger_(singer)" title="Jim Berger (singer)">Jim Berger (singer)</a></li> <li><a href="/wiki/The_All" title="The All">The All</a>, a Hermetic conception of God</li> <li><a href="/wiki/Allative_case" title="Allative case">Allative case</a> (abbreviated ALL)</li> <li>ALL, ISO 4217 currency code for the <a href="/wiki/Albanian_lek" title="Albanian lek">Albanian lek</a></li> <li>all is an ISO 639-3 code for <a href="/wiki/Allar_language" title="Allar language">Allar language</a></li> </ul> <div style="clear: right; margin-bottom: .5em; float: right; padding: .5em 0 .8em 1.4em; background: none; width: auto;"> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <